import React, {useState, useEffect} from 'react';
import logo from './logo.svg';
import './App.css';
import getGifs from './services/getGifs.js';


function App () {
  const {gifs, setGifs} = useState([]);

  useEffect(function () {
    getGifs({ keyword : 'hola' })
      .then(gifs => setGifs(gifs))
  }, []);

  return (
    <div className="App">
      <section className="App-content">
        {
          gifs.map(singleGif => {
            const {title, id, url} = singleGif;
            return (<div>
              <h5>{title}</h5>
              <small>{id}</small>
              <img src={url} />
            </div>)
          })
        }
       </section >
    </div>
   );
}

export default App;
